import { Box } from '@material-ui/core';
import React from 'react'
import Icon from '../img/Icon.png'
import styled from 'styled-components'


const BackgroundLogin = styled.div`
background-color: #292929;
height:100vh;
`
const ImageLogin = styled.img`
background-color: transparent;
width:128px;
padding-bottom: 36px;
`
const InputLogin = styled.input`
height: 56px;
width: 339px;
border-radius: 18px;
border: 0 none;
outline:0;
`
const textInput = styled.p`

`


function LoginPage() {
    return (
        <BackgroundLogin>
            <Box display = 'flex' justifyContent = 'center' flexDirection = 'column'
             alignItems = 'center' paddingTop = '250px'>
                <Box width = '50px' margin = 'auto' marginRight = '200px'>
                    <ImageLogin src ={Icon}>

                    </ImageLogin>
                    </Box>

                        <Box>
                        <InputLogin
                        placeholder = {'Usuário'}
                        
                        ></InputLogin>
                            </Box>

                            <div>
                        </div>
                    <div>
                </div>
            </Box>
        </BackgroundLogin>
    );
}

export default LoginPage;
